Road accident statistics are collected from information about personal injury road accidents and their consequent casualties, to a common national standard. The aim of collecting and publishing national road accident statistics is to inform public debate and to provide the basis for determining and monitoring effective road safety policies to reduce the road accident casualty toll. They are an essential requirement for monitoring targeted reductions in road accident casualties. The credible monitoring of targeted reductions requires that data are reported consistently and accurately, and both national and local government, and local reporting police forces, work closely to achieve a common reporting standard.&lt;br&gt;
&lt;br&gt;
Users should note that for 1985-1991, and from 2002 onwards, the Vehicle Record file does not contain breath test data. This change has been made in order to protect confidentiality.&lt;br&gt;
&lt;br&gt;
Data for 1985-1990 were deposited at the Archive at the beginning of 2006. Prior to this, the Archive only held the &lt;i&gt;Road Accident Data&lt;/i&gt; series from 1991 onwards. No extra documentation was available for the 1985-1990 data, so users are advised to consult the documentation for the 1991 survey.&lt;br&gt;
&lt;br&gt;
Further information about the &lt;i&gt;Road Accident Data&lt;/i&gt; series and research based on it may be found on the government &lt;a href="https://www.gov.uk/government/collections/road-accidents-and-safety-statistics" title="road accidents and safety statistics"&gt;road accidents and safety statistics&lt;/a&gt; webpages.&lt;br&gt;
&lt;br&gt;
These studies comprise information gathered using STATS19 and STATS20 forms.&lt;br&gt;
&lt;br&gt;

Beyond basic motives to seek food, water, affiliation and security, people's thoughts and actions are often guided by symbolic motives. These include 'identity motives', which guide people to see themselves in particular ways. Existing research suggests that people are motivated to see themselves in a positive light (the self-esteem motive), but also to believe that they are distinguished from others (the distinctiveness motive), that their identities persist through time (the continuity motive), that they are accepted by others (the belonging motive), that they are competent (the efficacy motive), and that their lives are ultimately meaningful (the meaning motive). Yet, little is known about the generality of these motives to people from non-Western cultural backgrounds, the majority of the world's population, and the little available evidence is controversial. &lt;br&gt;
&lt;br&gt;
The researchers have assembled a network of research collaborators in 34 nations chosen to provide a broad representation of global variation in cultural values. They designed two complementary studies to test these new theoretical ideas. Study 1 tested the hypotheses among high school students in 19 nations. A longitudinal design was used so data were collected over two different periods. Study 2 used a simplified design to reach adults in a larger number of cultural groups, aiming to sample maximum possible cultural diversity. In total, the research involved the participation of over 12,000 respondents in over 50 cultural groups.&lt;br&gt;
&lt;br&gt;
Further information is available on the &lt;a href="http://www.esrc.ac.uk/my-esrc/grants/RES-062-23-1300/read" title"Motivated identity construction in cultural context"&gt;Motivated identity construction in cultural context&lt;/a&gt; ESRC Award web page.&lt;br&gt;
&lt;br&gt;
For the second edition (September 2016), updated versions of the data files were deposited, with some erroneous cases corrected.&lt;br&gt;
&lt;br&gt;

The SPHERE Study: Secondary Prevention of Heart Disease in General Practice,  was the largest ever non-pharmaceutical trial in Irish general practice. The aim of the study was to design, implement and test the effectiveness of a complex intervention to improve the process of care and objective clinical outcomes for patients with established coronary heart disease in primary care.&lt;br&gt;
&lt;br&gt;
The SPHERE intervention was designed in consultation with patients and practitioners. Based on principles of patient-centred care, brief motivational interviewing and best practice in medication prescribing, it has the following components:  &lt;br&gt;
&lt;br&gt;
1. Practitioners attend two 90-minute training sessions, the first on facilitating lifestyle behaviour change, and the second on optimal medication prescribing for secondary prevention&lt;br&gt;
2. Patients visit the practice for review every four months&lt;br&gt;
3. Ongoing support is provided to practitioners by regional SPHERE research nurses&lt;br&gt;
4. A study newsletter is circulated to intervention practices every four months&lt;br&gt;
&lt;br&gt;
Patients with established coronary heart disease were selected from 48 general practices taking part in the study in the East, North and West Ireland. Half the practices were randomly chosen to receive the intervention for 18 months, while the other half continued to provide usual care to their patients. Detailed information about patient risk factors and health status was collected at the beginning of the study and again at the end. &lt;br&gt;
&lt;br&gt;
Further information, including results and publications, can be found on the &lt;a href="http://www.spherestudy.com/index.html" title="the SPHERE study"&gt;SPHERE&lt;/a&gt; study website.&lt;br&gt;
&lt;br&gt;
Users should note that the British Medical Journal (BMJ) article in the user guide has been included with the permission of the BMJ. It is covered by a Creative Commons licence, which allows &lt;b&gt;non-commercial&lt;/b&gt; use as long as the article is properly cited. To seek permission for commercial re-use, see the BMJ's &lt;a href="http://group.bmj.com/group/rights-licensing/permissions/permission-for-open-access-articles" title="Permission for Open Access articles"&gt;Permission for Open Access articles&lt;/a&gt; webpage.&lt;br&gt;

&lt;i&gt;National Child Development Study: Understanding Individual Behaviour, 2010&lt;/i&gt; is a pilot study completed by an inter-disciplinary network of researchers as part of the ESRC’s Understanding Individual Behaviour programme.  The network’s core aim was to explore individual differences in mid-life cognitive capacity and how these relate to experiences and behaviour earlier in life.  &lt;br&gt;
&lt;br&gt;
The pilot study was conducted with a sub-sample of NCDS members living in and around Cambridge in 2010, when study members were aged 52, and sought to investigate the potential for conducting neuro-psychological assessments with purposive sub-samples from the British Birth Cohort Studies. The aim was to recruit individuals with particular cognitive ability trajectories between childhood and mid-adulthood.  Childhood cognitive ability was measured using the age 11 General Ability Test (GAT).  Adult cognitive ability was measured using cognitive assessments conducted at age 50. Potential participants were invited to a research centre at the University of Cambridge to complete a 90 minute testing session which involved three main elements:&lt;ul&gt;&lt;li&gt;1. Repetition of the cognitive assessments included in the NCDS age 50 survey (NCDS8): a) Word-list recall/delayed word-list recall - a test of verbal learning and recall; b) Animal naming - a test of verbal fluency; c) Letter cancellation - a test of attention, mental speed and visual scanning.&lt;/li&gt;&lt;li&gt;2. Five CANTAB (Cambridge Neuropsychological Test Automated Battery) tasks: a) Paired Associates Learning test (PAL) - a visuospatial associative learning test which assesses visual memory and new learning; b) Graded Naming Test (GNT) - a test of semantic and/or verbal memory; c) Affective Go/No-go(AGN) - a test of affective decision making and information processing biases; d) Cambridge Gambling Task (CGT) - a test of decision making and risk taking; and e) Rapid Visual Information Processing (RVP) - a test of attention and general information processing.&lt;/li&gt;&lt;li&gt;3. A short self-completion questionnaire.&lt;/li&gt;&lt;/ul&gt;In total, 45 study members participated in the pilot study.&lt;br&gt;
&lt;br&gt;
Further information is available from &lt;a href="http://www.esrc.ac.uk/my-esrc/grants/RES-355-25-0026/read" title="Investigating the genetic, social and neuropsychological influences on individual differences in impulsivity and in memory using a lifecourse approach"&gt;investigating the genetic, social and neuropsychological influences on individual differences in impulsivity and in memory using a lifecourse approach&lt;/a&gt; ESRC Award web page.&lt;br&gt;
 The &lt;I&gt;National Child Development Study&lt;/I&gt; (NCDS) originated in the &lt;I&gt;Perinatal Mortality Survey&lt;/I&gt; (see SN 5565), which examined social and obstetric factors associated with still birth and infant mortality among over 17,000 babies born in Britain in one week in March 1958. Surviving members of this birth cohort have been surveyed on eight further occasions in order to monitor their changing health, education, social and economic circumstances - in 1965 at age 7, 1969 at age 11, 1974 at age 16 (the first three sweeps are also held under SN 5565), 1981 (age 23 - SN 5566), 1991 (age 33 - SN 5567), 1999/2000 (age 41/2 - SN 5578), 2004-2005 (age 46/47 - SN 5579), 2008-2009 (age 50 - SN 6137) and 2013 (age 55 - SN 7669).&lt;br&gt;
&lt;br&gt;
There have also been surveys of sub-samples of the cohort, the most recent occurring in 1995 (age 37), when a 10% representative sub-sample was assessed for difficulties with basic skills (SN 4992). Finally, during 2002-2004, 9,340 NCDS cohort members participated in a bio-medical survey, carried out by qualified nurses (SN 5594, available under more restrictive Special Licence access conditions; see catalogue record for details). The bio-medical survey did not cover any of the topics included in the 2004/2005 survey. Further NCDS data separate to the main surveys include a response and deaths dataset, parent migration studies, employment, activity and partnership histories, behavioural studies and essays - see the &lt;a href="http://discover.ukdataservice.ac.uk/series/?sn=2000032" title="NCDS series page"&gt;NCDS series page&lt;/a&gt; for details.&lt;br&gt;
&lt;br&gt;
Further information about the NCDS can be found on the &lt;a href="http://www.cls.ioe.ac.uk" title="Centre for Longitudinal Studies"&gt;Centre for Longitudinal Studies&lt;/a&gt; website.&lt;br&gt;
&lt;br&gt;
&lt;I&gt;How to access genetic and/or bio-medical sample data from a range of longitudinal surveys:&lt;/I&gt;&lt;br&gt;
A useful overview of the governance routes for applying for genetic and bio-medical sample data, which are not available through the UK Data Service, can be found at &lt;a href="http://www.metadac.ac.uk/data-access-through-metadac/" title="Governance of data and sample access"&gt;Governance of data and sample access&lt;/a&gt; on the METADAC (Managing Ethico-social, Technical and Administrative issues in Data Access) website.&lt;br&gt;
&lt;br&gt;

The aim of the &lt;i&gt;National Survey for Wales, 2009-2010: Pilot Study&lt;/i&gt; was to test the survey design, but also to provide valuable information for the Welsh Assembly Government on a range of issues.  The pilot survey was based on face-to-face interviews in a randomly chosen sample of households across Wales. In each of these households, the survey covered the head of household and a randomly selected adult (who may also be the head of household). There was also a short self-completion questionnaire for every adult in the household.&lt;br&gt;
 The &lt;I&gt;National Survey for Wales&lt;/I&gt; is carried out by the Office for National Statistics on behalf of the Welsh Government. The survey is a key source of information for the Welsh Government, other public sector organisations, and academics on the views and circumstances of people in Wales. It is carried out face-to-face with a random sample of over 10,000 adults a year. &lt;br&gt;
&lt;br&gt;
The National Survey brings together five surveys previously commissioned by the Welsh Government and three of its sponsored bodies (Natural Resources Wales, Sport Wales, Arts Council of Wales). These predecessor surveys were: the first set of National Survey for Wales, which ran from 2012-15 (SNs 7320, 7552, 7767, 7768, the 2009-10 pilot study, SN 6720, and its predecessor, the Living in Wales Survey 2004-08, held under SN 33397); the Welsh Health Survey 1998-2015 (held under SN 33371); the Active Adults Survey; the Arts in Wales Survey and the Welsh Outdoor Recreation Survey (none of these three series are currently held at the UK Data Archive).   &lt;br&gt;
&lt;br&gt;
Further information is available on the Welsh Government &lt;a href="http://gov.wales/statistics-and-research/national-survey/?lang=en" title ="National Survey for Wales"&gt;National Survey for Wales&lt;/a&gt; webpages.&lt;br&gt;
